 async getBody(url){
    const getData = await fetch(url);
    if(!getData.ok){
      throw new Error(getData.status)
    }
    const getJson = getData.json();
    return getJson
  };
 getPeople(){
   this.getBody("https://swapi.co/api/people")
 };
 getStarShips(){
   this.getBody("http https://swapi.co/api/starships")

 }
 getPlanets(){
   this.getBody("http https://swapi.co/api/planets")
 }
};


